import React from 'react';
import './App.css';
import {NavBar} from "./components/NavBar";
import {Header} from "./components/Header";
import {Footer} from "./components/Footer";
import {Content} from "./components/Content";

function App() {
    return (
        <div className="app-wrapper">
<Header/>
<NavBar/>

<Content/>
            <Footer/>

        </div>
    );
}


export default App;
